import React, { Component } from 'react';
import logo from "../../Frame 2566.svg";
import desconto from "../../desconto.svg";
import gift from "../../gift.svg";
import frete from "../../frete.svg";
import { MenuMobile } from './MenuMobile';
import mobileMenuIcon from "../../Assets/mobileMenu.svg";


import { Desconto, Frete, FreteP, GiftCard, HeaderWrapp, HomeHeader, TopBar, Button } from "./HeaderStyle";
import { useState } from 'react';




export function Header() {
    
    return (
        <>
            <MenuMobile menuIsVisible={menuIsVisible} setMenuIsVisible={setMenuIsVisible}><img src={mobileMenuIcon} onClick={setMenuIsVisible}/></MenuMobile>
            <HeaderWrapp>
                <TopBar>
                    <Desconto>
                        <img src={desconto} className="descontoIcon" />
                        <p>Desconto de 10% na primeira compra</p>
                    </Desconto>
                    <GiftCard>
                        <img src={gift} className="giftIcon" />
                        <p>Ganhe R$ 50,00</p>
                    </GiftCard>
                    <Frete>
                        <img src={frete} className="freteIcon" />
                        <FreteP>Entrega de até 48 horas para RJ e SP</FreteP>
                    </Frete>
                </TopBar>
                <HomeHeader>
                    <div className="logo">
                        <img src={logo} className="App-logo" alt="logo" />
                    </div>
                    <div className="menu">
                        <nav>
                            <a href="#">Notícias</a>
                            <a href="#">Tratamentos</a>
                            <a href="#">Produtos</a>
                            <a href="#">Soluções Cannect</a>
                        </nav>
                    </div>
                    <div>
                        <Button primary href="#">Profissionais</Button>
                        <Button primary href="#">Pacientes</Button>
                    </div>
                </HomeHeader>
            </HeaderWrapp>
        </>
    );
}

export default Header;
